export const namespaced = true;
const token = localStorage.getItem("token");
export const state = {
  jwt: token,
};
export const getters = {
  getToken: (state) => {
    return state.users;
  },
};
export const mutations = {
    SET_TOKEN: (state,token) => {
        state.jwt = token
    }
};

